import Navbar from './components/Navbar';
import './App.css';
import Home from "./components/Home";
import {
    BrowserRouter as Router , Routes, Route, Link
} from "react-router-dom";

function App() {
  return (
      <Router>


    <div className="App">
      {/*<h1> HELLO </h1>*/}
        <Navbar />
        <Routes>
            <Route path={'/home'} component={<Home /> }/>
        </Routes>
        <br/>


    </div>
      </Router>
  );
}

export default App;
